import React from "react";
import "./signUp.css";
import { Outlet, Link } from "react-router-dom";
function Login() {
  return (
    <div className="signup">
      <span className="heading greet">Login  </span>
      {/* <span className="h1 heading "> Project Of Guvi Assienment</span> */}

      <span className=" heading emailtxt">Enter the email</span>

      <input
        className="form__inset"
        typeof="text"
        placeholder="Email"
        name="email"
      />
      <span className=" heading emailtxt">Enter the Password</span>

      <input
        className="form__inset"
        typeof="text"
        placeholder="Password"
        name="email"
      />
      <span className=" heading emailtxt">Enter the Conform Password</span>

      {/* <input
        className="form__inset"
        typeof="text"
        placeholder="Password"
        name="email"
      /> */}
      <span className=" heading emailtxt">
        If You Don't Have An Account Please <Link to={'./SignUp'}/> <a href="">SignUp</a>{" "}
      </span>
    </div>
  );
}

export default Login;
